#pragma mark UIFont Extension

@implementation UIFont (FontAwesome)

+ (UIFont *) fontAwesomeFontForIcon:(FAIcon)code size:(CGFloat)size {
    if (code >= 100000 && code <= 199999) {
        return [UIFont fontWithName:@"FontAwesome5Brands-Regular" size:size];
    } else if (code >= 200000 && code <= 299999) {
        return [UIFont fontWithName:@"FontAwesome5Pro-Light" size:size];
    } else if (code >= 400000 && code <= 499999) {
        return [UIFont fontWithName:@"FontAwesome5Pro-Solid" size:size];
    }
    return [UIFont fontWithName:@"FontAwesome5Pro-Regular" size:size];
}

@end
